import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { ThreeDRotation } from '@mui/icons-material';
import Favorite from '@mui/icons-material/Favorite';
import { Button, CardActionArea, CardActions } from '@mui/material'
import EmojiFlagsIcon from '@mui/icons-material/EmojiFlags';
import WorkspacePremiumIcon from '@mui/icons-material/WorkspacePremium';
import VisibilityTwoToneIcon from '@mui/icons-material/VisibilityTwoTone';
import styled from '@emotion/styled'
import axios from "axios";
import { useState } from 'react';
import IconButton from '@mui/material/IconButton';
import SkipNextIcon from '@mui/icons-material/SkipNext';
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
import SkipPreviousIcon from '@mui/icons-material/SkipPrevious';
import overview from '../src/images/overview2.jpeg'

const baseURL = "https://tennis4you-heroku.herokuapp.com/contacts";

const Section = styled.section`
  background: #f5bb00;
  color: #000000;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 10px;
`


const cards = [1, 2, 3];

const theme = createTheme();

export default function Contacts() {
  const [result, setResult] = useState([]);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';

      let resposta
      Object.keys(response.data).map(function(key, index) {
      resposta = {...response.data}
    //  posts.push(response.data[key])
    setResult(response.data[key])
     // console.log(key, index, response.data[key].email)
      });     

      console.log(result)
      // console.log(posts)
    });
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <main>

    <Section>
      <Card sx={{ display: 'flex' }}>
      <Box sx={{ display: 'flex', flexDirection: 'column' }}>
        <CardContent sx={{ flex: '1 0 auto' }}>
          <Typography component="div" variant="h5">
            Aluguel de quadra
          </Typography>
          <Typography variant="subtitle1" color="text.secondary" component="div">
            Mac Miller
          </Typography>
        </CardContent>
        <Box sx={{ display: 'flex', alignItems: 'center', pl: 1, pb: 1 }}>
          <IconButton aria-label="previous">
            {theme.direction === 'rtl' ? <SkipNextIcon /> : <SkipPreviousIcon />}
          </IconButton>
          <IconButton aria-label="play/pause">
            <PlayArrowIcon sx={{ height: 38, width: 38 }} />
          </IconButton>
          <IconButton aria-label="next">
            {theme.direction === 'rtl' ? <SkipPreviousIcon /> : <SkipNextIcon />}
          </IconButton>
        </Box>
      </Box>
      <CardMedia
        component="img"
        sx={{ width: 151 }}
        image={overview}
        alt="Live from space album cover"
      />
    </Card>
    </Section>
      </main>
      {/* End footer */}
    </ThemeProvider>
  );
}
